import React, { useEffect, useState } from 'react';
import { Container, Card, Button, Table, Spinner } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';

const AdminDashboard = () => {
  const navigate = useNavigate();
  const [learners, setLearners] = useState([]);
  const [loading, setLoading] = useState(true);

  // Fetch data from SheetDB
  useEffect(() => {
    fetch('https://sheetdb.io/api/v1/131pnl5khpeib') // Your SheetDB API
      .then((res) => res.json())
      .then((data) => {
        setLearners(data);
        setLoading(false);
      })
      .catch((err) => {
        console.error("Error fetching data:", err);
        setLoading(false);
      });
  }, []);

  const learnerCount = learners.length;
  const avgPercentage = (
    learners.reduce((sum, learner) => sum + parseFloat(learner.Percentage || 0), 0) /
    (learnerCount || 1)
  ).toFixed(2);

  return (
    <Container className="mt-5">
      <Card className="p-4 shadow-sm">
        <h2 className="text-center mb-4">📊 Admin Dashboard</h2>

        <div className="d-flex justify-content-between flex-wrap mb-4">
          <div>
            <strong>Total Learners:</strong> {learnerCount}
          </div>
          <div>
            <strong>Average % Score:</strong> {avgPercentage}%
          </div>
          <div>
            <strong>Tests (approx):</strong> {Math.floor(learnerCount / 5)}
          </div>
        </div>

        <div className="text-center mb-4">
          <Button
            variant="success"
            href="https://docs.google.com/spreadsheets/d/1jDJNEb3HRQuuawbCJ0XP7KZQm3E7bYksUjS_0aCD8Qg/edit#gid=2092917562"
            target="_blank"
            className="me-3"
          >
            📂 Open Google Sheet
          </Button>
          <Button variant="secondary" onClick={() => navigate('/')}>
            🔙 Learner Login
          </Button>
        </div>

        <h5 className="mt-4">Sample Learner Data:</h5>
        {loading ? (
          <div className="text-center">
            <Spinner animation="border" variant="primary" />
          </div>
        ) : (
          <Table striped bordered hover responsive size="sm" className="mt-3">
            <thead>
              <tr>
                <th>Roll No</th>
                <th>Name</th>
                <th>Batch</th>
                <th>Physics</th>
                <th>Chemistry</th>
                <th>Botany</th>
                <th>Zoology</th>
                <th>Total</th>
                <th>%</th>
                <th>Rank</th>
              </tr>
            </thead>
            <tbody>
              {learners.slice(0, 10).map((learner, idx) => (
                <tr key={idx}>
                  <td>{learner.RollNo}</td>
                  <td>{learner.StudentName}</td>
                  <td>{learner.Batch}</td>
                  <td>{learner.Physics}</td>
                  <td>{learner.Chemistry}</td>
                  <td>{learner.Botany}</td>
                  <td>{learner.Zoology}</td>
                  <td>{learner.Total}</td>
                  <td>{learner.Percentage}</td>
                  <td>{learner.Rank}</td>
                </tr>
              ))}
            </tbody>
          </Table>
        )}
      </Card>
    </Container>
  );
};

export default AdminDashboard;
